import React from 'react';
import { Card, Avatar } from 'antd';

const UserProfile = () => {
  return (
    <Card
      actions={[
        <div></div>
      ]}
    >
      <Card.Meta 
        avatar={<Avatar>HW</Avatar>}
        title="Hwan"
      />
    </Card>
  );
}

export default UserProfile;
